import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const AddAppointment = () => {
    const [patients, setPatients] = useState([]);
    const [doctors, setDoctors] = useState([]);
    const [appointment, setAppointment] = useState({
        patientId: '',
        doctorId: '',
        appointmentDate: '',
        reason: '',
        status: 'Scheduled',
    });

    const navigate = useNavigate();

    useEffect(() => {
        axios.get('http://localhost:8080/api/patients')
            .then((res) => setPatients(res.data))
            .catch((err) => console.error(err));

        axios.get('http://localhost:8080/api/doctors')
            .then((res) => setDoctors(res.data))
            .catch((err) => console.error(err));
    }, []);

    const handleChange = (e) => {
        setAppointment({ ...appointment, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        axios.post('http://localhost:8080/api/appointments', {
            patient: { id: appointment.patientId },
            doctor: { id: appointment.doctorId },
            appointmentDate: appointment.appointmentDate,
            reason: appointment.reason,
            status: appointment.status,
        })
            .then(() => navigate('/appointments'))
            .catch((err) => console.error('Error adding appointment:', err));
    };

    return (
        <div className="container mt-5">
            <h2>Add Appointment</h2>
            <form onSubmit={handleSubmit}>
                <div className="mb-3">
                    <label>Patient:</label>
                    <select name="patientId" className="form-control" onChange={handleChange} required>
                        <option value="">Select Patient</option>
                        {patients.map((patient) => (
                            <option key={patient.id} value={patient.id}>
                                {patient.name}
                            </option>
                        ))}
                    </select>
                </div>

                <div className="mb-3">
                    <label>Doctor:</label>
                    <select name="doctorId" className="form-control" onChange={handleChange} required>
                        <option value="">Select Doctor</option>
                        {doctors.map((doctor) => (
                            <option key={doctor.id} value={doctor.id}>
                                {doctor.name} - {doctor.specialization}
                            </option>
                        ))}
                    </select>
                </div>

                <div className="mb-3">
                    <label>Appointment Date:</label>
                    <input
                        type="datetime-local"
                        name="appointmentDate"
                        className="form-control"
                        onChange={handleChange}
                        required
                    />
                </div>

                <div className="mb-3">
                    <label>Reason:</label>
                    <input
                        type="text"
                        name="reason"
                        className="form-control"
                        onChange={handleChange}
                        required
                    />
                </div>

                <div className="mb-3">
                    <label>Status:</label>
                    <select name="status" className="form-control" onChange={handleChange} required>
                        <option value="Scheduled">Scheduled</option>
                        <option value="Completed">Completed</option>
                        <option value="Cancelled">Cancelled</option>
                    </select>
                </div>

                <button type="submit" className="btn btn-primary">Add Appointment</button>
            </form>
        </div>
    );
};

export default AddAppointment;
